package Keyword;

public class frloops2 {

	void display() {
		
		for(int i=1;i<=10;i++) {
			
			for(int j=1;j<=10;j++) {
				
				System.out.println(i + "i value"  +"j value "   +j);
				
			}
			
		}
	}
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		frloops2 a1 = new frloops2();
		
		a1.display();

	}

}
